import React, { useEffect, useState } from 'react';

const ViewPackages = () => {
  const [packages, setPackages] = useState([]);

  useEffect(() => {
    // Fetch the data from the API
    fetch('http://localhost:8081/package/get-package')
      .then((response) => response.json())
      .then((data) => setPackages(data))
      .catch((error) => console.error('Error fetching packages:', error));
  }, []);

  return (
    <div>
      <h2>View Packages</h2>
      <table border="1" style={{ width: '100%', borderCollapse: 'collapse' }}>
        <thead>
          <tr>
            <th>ID</th>
            <th>Courier Name</th>
            <th>Courier Email</th>
            <th>Created On</th>
            <th>Delivery Address</th>
            <th>Pay on Delivery</th>
            <th>Status</th>
          </tr>
        </thead>
        <tbody>
          {packages.map((pkg) => (
            <tr key={pkg.id}>
              <td>{pkg.id}</td>
              <td>{pkg.courier ? pkg.courier.name : 'N/A'}</td>
              <td>{pkg.courier ? pkg.courier.mail : 'N/A'}</td>
              <td>{new Date(pkg.createdOn).toLocaleString()}</td>
              <td>{pkg.deliveryAddress || 'N/A'}</td>
              <td>{pkg.payOnDelivery ? 'Yes' : 'No'}</td>
              <td>{pkg.status || 'N/A'}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ViewPackages;
